(32, 56, 1, 'Muito legal o Workshop. Com certeza ajudará muito no dia-a-dia das nossas atividades.', 'adelmo.roberto-nascimento@tecban.com.br', '2020-12-01 11:05:12'),
(33, 56, 1, 'Automação perfeita, controle do jogo em tempo real, parabéns!', 'facilitador@scrum3d.com', '2020-12-01 10:31:21'),
