(35, 56, 1, 'Dinâmica interessante, pra colocar em prática os conceitos apresentados.', 'israel.zatta@tecban.com.br', '2020-12-01 11:05:26'),
(36, 56, 1, 'Experiência excelente! É um ótimo exercício para fixar a teoria apresentada nas aulas anteriores.', 'marcelo.nakamura@tecban.com.br', '2020-12-01 11:04:42'),
(37, 56, 1, '', 'emile.martins@tecban.com', '2020-12-01 11:05:13'),
(38, 56, 1, 'Muito produtiva a expediência do jogo.  ', 'william.rosario@tecban.com.br', '2020-12-01 11:05:39'),
(39, 56, 1, 'Amei a dinâmica pois permite entender na prática toda a teoria da metodologia. ', 'sara.araujo@tecban.com.br', '2020-12-01 11:05:47'),
(40, 58, 1, '', 'denis.moralez@tecban.com.br', '2020-12-02 11:04:30'),
(41, 58, 1, 'Esse treinamento foi muito gostoso. Não me lembro a última vez que participei de um treinamento tão legal. E realmente mostra a dinâmica do dia a dia.', 'lillian.smit@terceirizado.tecban.com.br', '2020-12-02 11:05:13'),
(42, 58, 1, '', 'ingrid.figueiredo-rezende@tecban.com.br', '2020-12-02 11:05:21'),
(43, 58, 1, '', 'david.soares-souza@tecban.com.br', '2020-12-02 11:05:37'),
(44, 58, 1, 'Muito legal o treinamento! Foi super dinâmico, e será super válido os aprendizados para aplicarmos em nosso dia a dia! As reuniões foram essenciais para melhorarmos os gaps e tornou o time ainda mais unido em prol do objetivo!', 'karolline.nunes@tecban.com.br', '2020-12-02 11:06:46'),
(45, 58, 1, 'Gostei bastante algumas informações teóricas ficaram muitas mais claras com a prática.', 'diego.moraes@tecban.com.br', '2020-12-02 11:07:40'),
(46, 58, 1, 'Foi muito Legal , a dinamica ajudou muito a materializar a parte conceitual.', 'marcelo.melo@tecban.com.br', '2020-12-02 11:07:46'),
(47, 58, 1, '', 'robert.almeida@tecban.com.br', '2020-12-02 11:21:54'),
(48, 60, 1, 'Motivo porque esta feliz.dnfdnfdnfdnfd', '1', '2020-12-12 12:21:56'),
(49, 64, 1, 'Foi muito legal para fixar o conteúdo!', 'felipe.guilherme-oliveira@tecban.com.br', '2021-01-27 11:20:29'),
(50, 64, 1, 'NA PRATICA O ENTENDIMENTO FICA MUITO MELHOR.', 'juliana.peres@tecban.com.br', '2021-01-27 11:20:39'),
(51, 64, 1, 'O jogo ajudou a entender a teoria! Ameeeeeeeeeeei.', 'bruna.cirino@tecban.com.br', '2021-01-27 11:20:57'),
(52, 64, 1, 'Excelente didática! A prática fez toda a diferença! Vivenciar cada etapa foi muito esclarecedor. Parabéns!', 'fatima.solovenco@terceirizado.tecban.com.br', '2021-01-27 11:22:29'),
(53, 64, 1, 'O Jogo ajudou a fixar o treinamento teórico, bem como a definição dos papéis de cada um. Sabendo que mesmo com as definições dos papéis todos podem colocar seus pontos de vista e ser discutido. O jogo é muuuito legal, lúdico e prático. Parabéns e obrigada pela disseminação do conhecimento!!!', 'gabriela.neiva@tecban.com.br', '2021-01-27 11:22:41'),
(54, 64, 1, 'Muito bom, adorei a restrição de não poder mexer nas peças quando estamos na cerimônia. Parabénssssssssss time de Práticas e Metodologia pelo jogo, sensacional!!!', 'Debora.Dominas@terceirizado.tecban.com.br', '2021-01-27 11:22:42'),
(55, 64, 1, 'uma belíssima experiência, muito bem instruído e repassado com uma boa didática, fico muito grato. Obrigado Evandro e equipe de métricas ágeis.', 'rafael.leite@tecban.com.br', '2021-01-27 11:22:43'),
(56, 64, 1, 'Muito interativo e um jeito fácil para elucidar a metodologia', 'marcio.carriel@tecban.com.br', '2021-01-27 11:23:00'),
(57, 64, 1, '', 'fernando.silva@tecban.com.br', '2021-01-27 11:23:03'),
(58, 64, 1, 'Muito bacana utilizar atividades simples para exemplificar as responsabilidades e atividades do método ágil. Gostei muito.', 'ellyn.nascimento@tecban.com.br', '2021-01-27 11:23:07'),
(59, 64, 1, '', 'tania.rocha@tecban.com.br', '2021-01-27 11:23:09'),
(60, 64, 1, 'Ficaram muito mais claros os papéis e cerimônias do Scrum através de um treinamento por meio da gamificação, uma ótima oportunidade de colocar em prática toda a parte teórica.', 'thalita.tome@tecban.com.br', '2021-01-27 11:23:35'),
(61, 64, 1, 'Muito boa a experiência.\nAprendi bastante sobre os papeis e responsabilidades do PO, Scrum e developers', 'josefa.sousa@tecban.com.br', '2021-01-27 11:26:45'),
(62, 64, 1, 'Experiência incrível! Sensacional a forma de aprender brincando assim e quando nota já está imerso nas metodologias aprendidas. Show de bola!', 'matheus.sanches@tecban.com.br', '2021-01-27 11:27:48'),
(63, 65, 1, '', 'ulysses.ramos-junior@tecban.com.br', '2021-01-28 11:38:57'),
(64, 65, 1, 'show!!!!\nSuper recomendo', 'michelli.barros@tecban.com.br', '2021-01-28 11:38:59'),
(65, 65, 1, 'Muito bom!! Parabéns pelo trabalho, adorei a dinâmica e entendi a metodologia na prática!!! ', 'bianca.teixeira@tecban.com.br', '2021-01-28 11:39:20'),
(66, 65, 1, 'Extremamente didático e simples de realizar. ', 'felipe.marques@tecban.com.br', '2021-01-28 11:39:23'),
(67, 65, 1, 'Excelente!! \nParabéns a todos os envolvidos, a ferramenta é muito boa! ', 'Aline.Silva@terceirizado.tecban.com.br', '2021-01-28 11:39:39'),
(68, 65, 1, 'Muito bom mesmo.', 'marcelo.leite-oliveira@tecban.com.br', '2021-01-28 11:39:43'),
(69, 65, 1, 'Foi ótima a experiência, tirando os pequenos bugs, deu para entender como funciona o modelo Agil.  ', 'luciana.lecca@tecban.com.br', '2021-01-28 11:39:53'),
(70, 65, 1, 'Feliz!\nImpactada positivamente com a metodologia e com o jogo em si. Muito bom!\nParabéns aos desenvolvedores.', 'cyntia.lima@tecban.com.br', '2021-01-28 11:40:04'),
(71, 65, 1, 'Achei incrível a plataforma, muito dinâmica e realista o que facilitou no aprendizado.', 'Isis.Ruiz@tecban.com.br', '2021-01-28 11:40:15'),
(72, 65, 1, 'Muito produtivo e dinâmico. Tivemos alguns problemas técnicos porém foi bom para aprendermos ainda mais e uma vivência mais completa. Os interlocutores foram excelentes e engrandeceram ainda mais a experiência. Parabéns (mas arruem as questões técnicas)!', 'fabio.soares-ferreira@tecban.com.br', '2021-01-28 11:40:33'),
(73, 65, 1, 'Muito Legal!', 'yasmin.sertorio@tecban.com.br', '2021-01-28 11:41:06'),
(74, 65, 1, 'Foi muito bom!\nO jogo é muito interessante e dinâmico, o visual é super legal. Adoraria participar diversas vezes.\nComo oportunidade rever apenas alguns possíveis problemas como a questão de algumas histórias que \"sumiram\" e limitação de tela para as peças do quebra-cabeças não serem deslocadas totalmente para o canto da página, dificultando a visualização e montagem.', 'gabriela.mori@tecban.com.br', '2021-01-28 11:41:41'),
(75, 65, 1, '', 'larissa.araujo@tecban.com.br', '2021-01-28 11:42:17'),
(76, 65, 1, 'O Workshop trouxe a clareza de como podemos aplicar as metodologias em nosso cotidiano. Adorei a experiência! Muito obrigada!', 'natani.moraes@tecban.com.br', '2021-01-28 11:43:37'),
(77, 65, 1, '', 'gabriela.souza@terceirizado.tecban.com.br', '2021-01-28 11:43:38'),
(78, 65, 1, 'O jogo foi mto bacana e todo conteúdo muito claro e completo. Bom para dar um refresh de conceitos e sempre absorvemos conhecimento.', 'gabriella.ovieo@terceirizado.tecban.com.br', '2021-01-28 11:57:48'),
